import React from "react";
import "./App.css";
import FileUploadButton from "./components/FileUploadButton";

function App() {
  return (
    <div
      className="App"
      style={{
        display: "flex",
        flexDirection: "column",
        justifyContent: "center,"
      }}
    >
      <header className="App-header">
        <p>lbconverter </p>
        <FileUploadButton />
      </header>
    </div>
  );
}

export default App;
